import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

import MyNavbar from "./components/MyNavbar";
import MyFooter from "./components/myFooter";
import MyGallery from "./components/MyGallery";
import Settings from "./components/Settings";

function App() {
  return (
    <div className="App bg-dark">
      <MyNavbar />
      <main id="card" className=" text-white">
        <MyGallery nameMovies={"batman"}></MyGallery>
        <MyGallery nameMovies={"star wars"}></MyGallery>
        <MyGallery nameMovies={"game of thrones"}></MyGallery>
      </main>
      <Settings />
      <MyFooter />
    </div>
  );
}

export default App;
